const root = ReactDOM.createRoot(document.getElementById('root'));
//const clientId = "873681028967-vd063dh6atqsldkfdkkaqbsajdm01em3.apps.googleusercontent.com";
root.render(
  <React.StrictMode>
    <GoogleOAuthProvider clientId={process.env.clientId}> {/* Wrap your app with GoogleOAuthProvider */}
    <BrowserRouter>
      <App />
    </BrowserRouter>
    </GoogleOAuthProvider>
  </React.StrictMode>
);
